import Sequelize from 'sequelize';
import fs from 'fs';
import path from 'path';

let db = null;

module.exports = app => {

  const config = app.libs.config;


  if (!db) {

    const sequelize = new Sequelize(

      config.database,
      config.username,
      config.password,
      config.params
    );

    db = {
      sequelize,
      Sequelize,
      models: {}
    };

    const dir = path.join(__dirname, 'modelos');

    fs.readdirSync(dir).forEach(filename => {

      console.log("---------------->Adding model: ", filename);
      const modelDir = path.join(dir, filename);
      const model = sequelize.import(modelDir);
      db.models[model.name] = model;
    });
    console.log("All Models charged ----> ", db.models);

    Object.keys(db.models).forEach(key => {
      console.log("****************assosiating: ", db.models[key].name);
      db.models[key].associate(db.models);
    });

  }
  console.log('modelos a exportar en database:', db.models)

  return db;

}

