module.exports = (sequelize, DataType) => {
  const auth = sequelize.define('auth', {
    id: {
      type: DataType.INTEGER,
      primaryKey: true,
      autoIncrement: true
    },
    pass: {
      type: DataType.STRING,
      allowNull: true
    }
  }, {
    timestamps: false,
    freezeTableName: true
  });
  return auth;
};
